import ProductCart from "../shared/ProductCart"

const ProductList = (props) => {
    const {elements} = props

    return (
        <ul>
            {elements.map((elements, i) => <ProductCart name={elements.name} discount={elements.discount} price={elements.price}></ProductCart>)}
        </ul>
    )
}

export default ProductList
